  false,\n\t\"url\": null,\n\t\"notes\": \"Juvenile rockfish were observed amongst
  coral, sponge, cobble, and gravel habitats. Rockfish utilized coral habitats more
  than any other, while gravel was the least utilized. Sponge and cobble habitat utilization
  was intermediate to coral and gravel. Predation of young-of-the-year rockfish by
  sculpin predators was greatest in gravel habitats and lowest in coral habitats.\",\n\t\"owner_org\":
